import React from "react";
import {
  Text,
  Flex,
  Box,
  VStack,
  HStack,
  Icon,
  Badge,
  Spacer,
  Divider,
  Pressable,
  Button,
  Center,
  Input,
} from "native-base";
import RidersCard from "../../../_shared/libs/Riders_MoneyFlow_Card";
import { Entypo, SimpleLineIcons, AntDesign } from "@expo/vector-icons";

const Login = () => {
  return (
    <Box w="100%" flex={1} backgroundColor="#F6F5F5" px="8" pt="60px">
      <Center>Hi</Center>
         <Box>
          <HStack>
            <Text>Sign</Text>
            <VStack>
              <Text>Up</Text>
              <Divider borderRadius="2" thickness="4" bg="#f00" />
            </VStack>
          </HStack>
          <Text>Confirm your details and create password</Text>
        </Box>

        <VStack space={4}>
          <Box>
            <Text>Full Name</Text>
            <Input variant="underlined" placeholder="Underlined" />
          </Box>

          <Box>
          <Text>Full Name</Text>

            <Input variant="underlined" placeholder="Underlined" />
          </Box>

          <Box>
          <Text>Create Password</Text>

            <Input variant="underlined" placeholder="Underlined" />
          </Box>

          <Box>
          <Text>Confirm Password</Text>

            <Input variant="underlined" placeholder="Underlined" />
          </Box>

        </VStack>
      </Box>
   
  );
};

export default Login;
